import React from "react";
import acm from "./images/acm.jfif";
import Card from "./Card";
import Sdata from "./Sdata";
function Clubs() {
  return (
    <div className="container">
        <h1 className="text-center a">SVNIT's Student Chapters</h1>
      <div class="row">
          {
            Sdata.map((val,ind)=>{
                return <Card 
                imgsr={val.imgsr}
                title={val.title}
                content={val.content}
                insta={val.insta}
                />
            })
          }
        </div>
        <div>
        <h1>Do you still have any Query?</h1>
        <h4>Don't Worry!! Feel free to contact me.</h4>
      <a class="btn btn-primary btn-rounded rounded" href="/clubs">Contact Us</a>
      </div>
      </div>
  );
}
export default Clubs;
